INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Francis Ford Coppola', '1939-04-07', 'Detroit, Michigan, USA', 'nm0000338', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTM5NDU3OTgyNV5BMl5BanBnXkFtZTcwMzQxODA0NA@@._V1_.jpg', 'Francis Ford Coppola was born in 1939 in Detroit, Michigan, but grew up in a New York suburb in a creative, supportive Italian-American family. His father, Carmine Coppola, was a composer and musician. His mother, Italia Coppola (n√©e Pennino), had been an actress.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Marlon Brando', '1924-04-03', 'Omaha, Nebraska, USA', 'nm0000008', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTg3MDYyMDE5OF5BMl5BanBnXkFtZTcwNjgyNTEzNA@@._V1_.jpg', 'Marlon Brando is widely considered the greatest movie actor of all time, rivaled only by the more theatrically oriented Laurence Olivier in terms of esteem. Unlike Olivier, who preferred the stage to the screen, Brando concentrated his talents on movies after bidding the Broadway stage adieu in 1949, a decision for which he was severely criticized when his star began to dim in the 1960s and he was excoriated for squandering his talents.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Al Pacino', '1940-04-25', 'Manhattan, New York City, New York, USA', 'nm0000199', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTQzMzg1ODAyNl5BMl5BanBnXkFtZTYwMjAxODQ1._V1_.jpg', 'One of the greatest actors in all of film history, Al Pacino established himself during one of film\'s greatest decades, the 1970s, and has become an enduring and iconic figure in the world of American movies.Pacino was born on April 25, 1940, in the Bronx, New York, to an Italian-American family.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('James Caan', '1940-03-26', 'The Bronx, New York, USA', 'nm0001001', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTI5NjkyNDQ3NV5BMl5BanBnXkFtZTcwNjY5NTQ0Mw@@._V1_.jpg', 'A masculine and enigmatic actor whose life and movie career have had more ups and downs than the average rollercoaster and whose selection of roles has arguably derailed him from achieving true superstar status, James Caan is New York-born and bred.He was born in the Bronx, to Sophie (Falkenstein) and Arthur Caan, Jewish immigrants from Germany.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Richard S. Castellano', '1933-09-04', 'The Bronx, New York City, New York, USA', 'nm0144710', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjI2MzA3MjQ5N15BMl5BanBnXkFtZTcwMzY5NDYwOA@@._V1_.jpg', 'Bronx born, stocky Italian-American actor who only appeared in a handful of films, yet earned some degree of immortality for his role as the loyal Corleone capo "Peter Clemenza" teaching Al Pacino how to shoot a crooked police captain in the iconic gangster film "The Godfather".');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Robert Duvall', '1931-01-05', 'San Diego, California, USA', 'nm0000380', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjk1MjA2Mjc2MF5BMl5BanBnXkFtZTcwOTE4MTUwMg@@._V1_.jpg', 'Veteran actor and director Robert Selden Duvall was born on January 5, 1931, in San Diego, CA, to Mildred Virginia (Hart), an amateur actress, and William Howard Duvall, a career military officer who later became an admiral. Duvall majored in drama at Principia College (Elsah, IL), then served a two-year hitch in the army after graduating in 1953.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Sterling Hayden', '1916-03-26', 'Upper Montclair, New Jersey, USA', 'nm0001330', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjE0MTk1NjkzN15BMl5BanBnXkFtZTcwMzA1MjE1Mg@@._V1_.jpg', 'Born to George & Frances Simonson Walter, and named Sterling Relyea Walter. Father died in 1925. Adopted by stepfather \'James Hayden\' renamed Sterling Walter Hayden. Grew up in New Hampshire, Massachusetts, Pennsylvania, Washington D.C., and Maine. Though very poor, attended prep school at Wassookeag School in Dexter, Maine.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('John Marley', '1907-10-17', 'Harlem, Manhattan, New York City, New York, USA', 'nm0549134', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjk0NjY1MjAyMl5BMl5BanBnXkFtZTcwNzY5NDYwOA@@._V1_.jpg', 'Veteran character actor John Marley was one of those familiar but nameless faces that television and filmgoers did not take a shine to until the late 1960s, when he had hit middle age. Distinctive for his craggy face, dark bushy brows and upswept silvery hair, his life (born in 1907) started out amid tough surroundings in Harlem, New York, as the son of Russian immigrants.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Richard Conte', '1910-03-24', 'Jersey City, New Jersey, USA', 'nm0002017', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNzE0MzU0MzY3OF5BMl5BanBnXkFtZTcwMjE2MjYwOA@@._V1_.jpg', 'Richard Conte was born Nicholas Richard Conte on March 24, 1910, in Jersey City, New Jersey, the son of an Italian-American barber. The young Conte held a variety of jobs before becoming a professional actor, including truck driver, Wall Street clerk and singing waiter at a Connecticut resort.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Al Lettieri', '1928-02-24', 'New York City, New York, USA', 'nm0504803', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjA0NDI4MzIwMV5BMl5BanBnXkFtZTcwNjgwMDM1NA@@._V1_.jpg', 'Menacing looking Italian American actor who developed into the quintessential on-screen hoodlum via several strong roles in key crime films of the early 1970s. Lettieri played the villain against some of Hollywood\'s biggest screen names including chasing Steve McQueen in "The Getaway", intimidating Charles Bronson in "Mr.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Diane Keaton', '1946-01-05', 'Los Angeles, California, USA', 'nm0000473', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNjU5NjMwOTk2NV5BMl5BanBnXkFtZTYwODg1NzY0._V1_.jpg', 'Diane Keaton was born Diane Hall in Los Angeles, California, to Dorothy Deanne (Keaton), an amateur photographer, and John Newton Ignatius "Jack" Hall, a civil engineer and real estate broker. Her ancestry includes Irish, English, German, and Scottish.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Abe Vigoda', '1921-02-24', 'Brooklyn, New York City, New York, USA', 'nm0001820', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjE1MDk5NzMyN15BMl5BanBnXkFtZTYwMjA4Mjg1._V1_.jpg', 'Tall, dour-faced and slouch-shouldered character actor Abe Vigoda proved himself in both gritty dramatic roles, and as an actor with wonderful comedic timing.Vigoda was born in Brooklyn, New York, to Lena (Moses) and Samuel Vigoda, both Russian Jewish immigrants.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Talia Shire', '1946-04-25', 'Lake Success, Long Island, New York, USA', 'nm0001735', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTkwMzc0NjQzNV5BMl5BanBnXkFtZTYwNzM0NTk3._V1_.jpg', '');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Gianni Russo', '1943-12-12', 'Manhattan, New York City, New York, USA', 'nm0751625', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNTgyMTgxODM4MV5BMl5BanBnXkFtZTcwNDg5NDYwOA@@._V1_.jpg', 'With a singularly nebulous background, which, by his account, included stints as a Las Vegas nightclub emcee, radio personality and jewelry tycoon, and with comparatively little acting experience, Gianni Russo won the role of Carlo Rizzi in "The Godfather" on the basis of his screen test.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('John Cazale', '1935-08-12', 'Boston, Massachusetts, USA', 'nm0001030', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTUzMTM1MjI5NV5BMl5BanBnXkFtZTcwMTM5NTM1Mw@@._V1_.jpg', 'John Cazale was born in Boston, Massachusetts, to an Irish-American mother, Cecilia (Holland), and an Italian-American father, John Cazale. Cazale only made five feature films in his career, all which many fans and critics alike call classics. But before his film debut, the short "The American Way", he won numerous Obie Awards for his stage performances in "The Indian Wants the Bronx" and "The Line".');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Rudy Bond', '1912-10-01', 'Philadelphia, Pennsylvania, USA', 'nm0094036', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', 'Rudolph Bond was raised in Philadelphia. He got his start at the Neighborhood Players. After World War II, he was invited by Elia Kazan to be a student at the famed "Actors Studio" in New York, working with such future stars as Paul Newman, James Dean, and Marlon Brando.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Al Martino', '1927-10-07', 'Philadelphia, Pennsylvania, USA', 'nm0553887', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjMyMDk4MzYyMl5BMl5BanBnXkFtZTcwNzg5NDYwOA@@._V1_.jpg', '');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Morgana King', '1930-06-04', 'Pleasantville, New York, USA', 'nm0455088', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', '');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Lenny Montana', '1926-03-13', 'Brooklyn, New York City, New York, USA', 'nm0598926', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', 'Tall and solidly built, this Italian-American professional wrestler turned actor was born Lenny Passaforo in Brooklyn, New York, and is best remembered for his first on-screen role as the not too bright but ever loyal bodyguard Luca Brasi in "The Godfather".');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('John Martino', '1937-05-05', 'Brooklyn, New York, USA', 'nm0553908', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTUzNTgzNTg5MV5BMl5BanBnXkFtZTgwOTMzODU3NjE@._V1_.jpg', 'John was born and raised in Brooklyn, New York. As a teenager he began his singing and acting career. He studied with John Cassavetes, American Academy of Dramatic Arts and Universal Art Studios, which led to a role in the off-Broadway show "Hat Full of Rain.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Salvatore Corsitto', '1913-01-09', 'Canicattini Bagni, Sicily, Italy', 'nm0181128', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', '');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Richard Bright', '1937-06-28', 'Brooklyn, New York, USA', 'nm0109175', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', 'Fair complexioned, cold-eyed actor Richard Bright has notched up an impressive array of character performances of often shifty, or deadly characters on the wrong side of the law. First came to attention as a burglar in the engrossing "The Panic in Needle Park", and then followed it the following year playing a slick con artist hustling naive Ali MacGraw for the bank robbery loot in "The Getaway", before Steve McQueen pummels Bright to get the money back.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Alex Rocco', '1936-02-29', 'Cambridge, Massachusetts, USA', 'nm0733678', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTk3MTMyNTkxOF5BMl5BanBnXkFtZTcwMDA4NTAzMQ@@._V1_.jpg', 'Tough and volatile-looking Italianate character actor Alex Rocco was born in Boston and spent time training with such notable teachers as Leonard Nimoy and Jeff Corey to curb his thick Boston accent. In Hollywood from 1963, he worked as a bartender during the lean years and began his TV career in the late 60s.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Tony Giorgio', '1923-09-27', 'Herkimer, New York, USA', 'nm0320413', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', 'Tony Giorgio was born in Herkimer, NY on September 27, 1923. He grew up in Schenectady, NY during The Great Depression and began his career in show business as a professional "amateur", performing magic in talent shows for pay. At the age of twelve, he ran away from home to join a circus and performed magic in the side show.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Vito Scotti', '1918-01-26', 'San Francisco, California, USA', 'nm0780005', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTY4MzMwOTU3Ml5BMl5BanBnXkFtZTcwNTE0MzkxOA@@._V1_.jpg', 'With his dark features and having spent much of his early years in Naples, Italy, Vito Scotti was understandably typecast as Italian waiters, government functionaries, policemen, maitre d\'s and barbers. When Vito was seven, the Scottis moved back to the U.');
