INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Pierre Jalbert', '1925-01-09', 'Qu√©bec City, Qu√©bec, Canada', 'nm0416097', 'https://images-na.ssl-images-amazon.com/images/M/MV5BYTgwMjA3OTEtNmVhZS00ZmRmLTkxYzUtZDI3Yjg3OGM1NTdjXkEyXkFqcGdeQXVyMzI5NDcxNzI@._V1_.jpg', 'The son of a newspaperman, Canadian-born Pierre Jalbert graduated from Ouellet College and attended Laval University. A champion skier, he went to study art appreciation at the Sorbonne in Paris. In 1949 he visited Hollywood and later that year returned to Paris and joined a French film company as a production assistant.');
