INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('A.D. Flowers', '1917-02-22', 'Hillsboro, Texas, USA', 'nm0283166', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', 'For more than thirty years, A. D. Flowers worked his magic in movies and on TV and ended his career as one of Hollywood\'s most highly respected and sought-after special effects experts. His craft, however, predated the now-universally employed computerized high-tech FX that the movie and TV industry relies upon today.');
