INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Bill Roper', '1965-03-27', 'Concord, California, USA', 'nm0974546', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTUyNDk1OTU0Ml5BMl5BanBnXkFtZTcwODIxMTY4Ng@@._V1_.jpg', 'Bill Roper started in the video game industry in 1994 and has headed video game studios and creative & development departments for two decades, including divisions at Blizzard Entertainment, Flagship Studios, Cryptic Studios, and Disney Interactive. His work includes the Warcraft, Starcraft, and Diablo series, Champions Online, Star Trek Online, Hellgate: London, and most recently Disney Infinity and Fantasia: Music Evolved.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Paul Baxley', '1923-09-24', 'Casper, Wyoming, USA', 'nm0062656', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', 'Paul Baxley was born in Casper Wyoming in 1923. Growing up in Los Angeles, he went on to become an all-city quarterback and track star at Eagle Rock High.A Marine, a Scout and Sniper in the 4th Division in World War II, he fought on Kwajalein (Roi-namur), Iwo Jima, Saipan and Tinian.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Joe Bucaro III', '1964-04-04', 'Wheaton, Illinois, USA', 'nm0117851', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNTM4Mjg4MzgwOF5BMl5BanBnXkFtZTcwNDM5Mzc1NA@@._V1_.jpg', 'Joe grew up in Park Ridge and Wheaton, Illinois, for 27 years. Ever since watching Evel Knievel live at the old Chicago amphitheater jump 10 buses at age 8 and seeing "Hooper" in the theaters as an impressionable 13-year-old boy, he knew he wanted to become a Hollywood Stuntman.');
