INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Paul Salamunovich', '1927-06-07', 'Redondo Beach, California, USA', 'nm0757536', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', 'Acclaimed Grammy¬Æ-nominated choral conductor and Los Angeles Master Chorale (LAMC) Music Director Emeritus Paul Salamunovich, whose artistry touched millions of people around the world through recordings, live performances, college and university clinics, and the numerous film scores on which he conducted and sang, has died at age 86 from multiple complications due to West Nile virus.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Stephen Salamunovich', '1958-03-11', 'Burbank, California, USA', 'nm1641535', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTk3NzQ4NTkyOF5BMl5BanBnXkFtZTgwOTg2NTU1MzE@._V1_.jpg', 'Stephen Salamunovich CSA, brings a diverse background to his 30 year career as a casting director. He began his professional life as a musician performing and recording as a vocal soloist with such groups as the Los Angeles Philharmonic, the San Francisco Opera Company, the Los Angeles Master Chorale, the soundtrack of "The Godfather" and the Disney recording of "It\'s a Small World".');
